private String setToString(Set<String> set) {
  StringBuilder sb = new StringBuilder();
  int i = 1;
  for (String s : set) {
    sb.append("/" + s);
    if (i != set.size()) {
      sb.append(", ");
    }
    i++;
  }
  return sb.toString();
}
